import { connect } from "react-redux";
import { Button } from "antd";

const Index = () => (
  <div id="wrapper">
    <p>Hello Next.js</p>
    <Button type="danger">Primary</Button>

    <style jsx>{`
      #wrapper {
        margin: 10px;
      }
    `}</style>
  </div>
);

const mapStateToProps = state => ({
  user: state.user.currentUser
});

export default connect(mapStateToProps)(Index);
